description:
Lampe de camping à LED multifonctions Lampe de poche pour randonnée en plein air Lampe de table intérieure rechargeable par USB Banque d’alimentation d’urgence
Spécification:
Couleur : rouge, vert, bleu ;Matériau : ABS ;
Taille: 8,5×1 5 cm/3,35 x 5,91 pouces;
Alimentation : batterie au lithium 18650 intégrée ;
Autonomie de la batterie : 5 à 8 heures ;
Tension : 3,7 V-4,2 V ;
Chargement : USB-5V-1A (interface USB universelle) ;
Perles de lampe : mèche de surbrillance ;
Distance de prise de vue : 100-200 m ;
Puissance : 5 W ;
Luminosité : 350 lm ;
Caractéristiques:
 -3 en 1, lampe de table, lampe de poche, batterie externe de secours.
 -Éclairage à 3 niveaux, le meilleur compagnon pour le camping en plein air.
 -Mèche LED, éclairage puissant et lumière longue distance.
 -Multi-angle et multidirectionnel réglable, répond à vos différents besoins.
 -Pratique et portable, batterie de grande capacité, chargement USB.
 -Éclairage, conduite de nuit, urgence, camping, lampe domestique, lampe de signalisation, banque d'alimentation de secours 
-Super lumineux et multifonctionnel
 La lampe de camping LED 3 en 1 est une lampe de bureau et des lampes de camping. Cette lampe lanterne LED a une large gamme d'utilisation, qui est non seulement peut être utilisée comme une lampe de poche de camping pour les activités de plein air, comme une lampe de bureau pour étudier à la maison. Les ampoules LED sont parmi les meilleures ampoules de l'industrie en matière de luminosité, d'économie d'énergie et de faible consommation d'énergie, MEILLEUR pour la recherche, le camping et la randonnée, les pannes de courant.
 -Conception unique
 Vous pouvez changer la forme et ajuster l'angle, 180 degrés librement, éclairage rotatif à 360 degrés. Avec ses caractéristiques de pliage, il est facile pour vous de l'ajuster comme une lampe de bureau, parfaite pour votre lecture, travail, étude.
 -Chargement USB et banque d'alimentation
